exports.pluginOptionsSchema=({Joi:a})=>a.object({siteUrl:a.string().required().description(`The full URL for the site e.g. https://www.example.com`),stripQueryString:a.boolean().description(`Enables stripQueryString to strip query strings from paths e.g. /blog?tag=foobar becomes /blog.`),stripHash:a.boolean().description(`Enables stripHash to strip hash from url e.g. /blog#tag/foo becomes /blog.`)});